script: |
  super -f tsv -I q9150.sql | sort > q9150.out

vector: true

inputs:
  - name: q9150.sql
    data: |
      pragma pg
      SELECT DISTINCT CAST ( NULL AS INTEGER ) * CAST ( NULL AS INTEGER ) + + 13 - col0 * + col0 - - ( - 64 ) * col2 + 95 AS col1 FROM tab1 WHERE NULL IS NOT NULL GROUP BY col2, col1, col0 HAVING NULL NOT BETWEEN - col1 AND NULL;
  - name: tab1

outputs:
  - name: q9150.out
    data: |
